import React, { Component } from 'react'
import axios from 'axios'

export default class Creatures extends Component {
    state = {
        creatureList: []
    }

componentDidMount() {
    console.log(this.state.creatureList)
    axios.get('/api/creatures') 
    .then((res) => {
        this.setState({ creatureList: res.data})
    })
}


    render() {
        return (
            <div>
                <h1>Hi</h1>
            </div>
        )
    }
}
